import { SearchListItem } from './SearchListItem';

export const SearchList = ({ result, isSearching }) => {
  console.log( result );
  const ListResult = (()=>{

    if( !result?.length && isSearching )
       return <p className='search-top'>No existen resultados</p>
    else{
      result?.map((value)=>{        
          return(<SearchListItem
              key = {value.id}
              {...value}
          />)
      })
    }
  })  
  return (
    <div>     
      { ListResult }
    </div>
  )
}
